column5:
a usuária cadastrada com o cpf indormado possui as seguintes informações:
Login:vn0vi3v
Regional: WM SE.
Se as informações digitadas estiverem de acordo com as informações acima, sugiro seguir os seguintes passos para reset de senha:
- O associado deve entrar no portal gestão de identidade (https://portalgestaodeidentidade.br.wal-mart.com/idm/walmart/);
- Clicar em Meu menu -> reset de senhas-> alterar senhas;
- Clicar em sistemas conectados;
- Clicar no botão search e em seguida selecionar o sistema desejado (neste caso o voiza). Observe que neste momento aparecerá o login de acesso ao voiza;
- Clique em alterar senha e gere uma senha acima de 7  dígitos (letras maiúsculas + minúsculas + números);

